import { Card } from 'semantic-ui-react';



function PlacesSummary({ placesdata }) {

    console.log(placesdata)
    function mapPlaces(placesdata) {
        return placesdata.map(place => ({
            header: place.name,
            //meta: place.description,
            color: 'teal',
            fluid: true,
            childkey: place._id,
            // href: `/product?_id=${place._id}`,
            //image: place.picture,

        }))
    }


    return <>
        <div className="row">
            <div className="col-md-4 ftco-animate">
                <div className="project-wrap">
                    <img href="#" className="img" src="background-image: url(https://upload.wikimedia.org/wikipedia/commons/7/71/Kenta_Kerr.JPG);"/>
                    <div className="text p-4">
                        <span className="price">$300/person</span>
                        <span className="days">8 Days Tour</span>
                        <h3><a href="#">  </a></h3>
                        <p className="location"><span className="ion-ios-map"></span>  </p>
                        <ul>
                            <li><span className="flaticon-shower"></span>2</li>
                            <li><span className="flaticon-king-size"></span>3</li>
                            <li><span className="flaticon-mountains"></span>  </li>
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    </>;
}


export default PlacesSummary;
